// Контейнер для отображения элементов карточек с задачами
import React, {Component} from 'react'
import './Main.scss'
import Card from '../../components/Card/Card'
import AddCard from '../../components/UI/AddCard/AddCard'

export default class Main extends Component{

    render() {
        return (
            <div className='Main'>
                {this.props.cards.map((key) => {
                    return(
                        <Card 
                          key={key.key} 
                          keyx={key.key} 
                          activeFolderKey={this.props.activeFolderKey}
                        />
                    )
                })}
                <AddCard addCard={this.props.addCard} />
            </div>
        )
    }
}
